import React, { Component } from "react";

export default class Home extends Component {
  render() {
    return (
      <div id="home" className="page-container">
        <h1>Hi! I'm Hui Lin</h1>
        <h2>web developer based in Singapore</h2>
      </div>
    );
  }
}
